import React from "react";
import "./signup.css";
import { useNavigate } from "react-router-dom"; 

export const Signup = () => {
  const navigate = useNavigate();

  const handleSignup = (e) => {
    e.preventDefault();
    console.log("Signing up...");
    navigate("/auth/login"); // Navigate to Login page after signup
  };

  return (
    <div className="signup-left">
      <div className="signup-form">
        <h1>Sign Up</h1>
        <form>
          <div className="fullname-input">
            <input type="text" placeholder="Full Name" />
          </div>
          <div className="email-input">
            <input type="email" placeholder="Enter email" />
          </div>
          <div className="emailVerify-input">
            <input type="email" placeholder="Verify email" />
          </div>
          <div className="phone-input">
            <input type="tel" placeholder="Phone Number" />
          </div>
          <div className="password-input">
            <input type="password" placeholder="Create password" />
          </div>
          <div className="passwordVerify-input">
            <input type="password" placeholder="Verify password" />
          </div>
          <button type="submit" className="signup-button" onClick={handleSignup}>
            Sign Up
          </button>
        </form>
        <div className="login">
          Already have an account?{" "}
          <span className="nav-link" onClick={() => navigate("/auth/login")}>
            Login here
          </span>
        </div>
      </div>
    </div>
  );
};

export default Signup;
